import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import {homeObjThree} from "./HomeData";

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
        <InfoSection {...homeObjThree} />
      <Footer />
    </>
  );
}

export default Home;
